description:
Who said acting was easy? At ZZ Academy, competition is fierce for roles in the school play. But Ashley Graham wants to perform so badly she just can't deal. At today's try-outs, she's prepared to pull out all the stops to impress Johnny and convince him she's enough of a sex-kitten to play the trampy tiger.


